import { Container } from "./styles";

const Input = ({ error, name, setHeight, setWidth, ...rest }) => {
  return (
    <Container setHeight={setHeight} setWidth={setWidth}>
      <input {...rest} />
      <div>{error}</div>
    </Container>
  );
};

export default Input;
